webpackJsonp([47396178192604],{4792:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Monday Night",date:"09 Oct 2000",slug:"/2000-10-09-monday-night/",tags:"Y2000"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/10/mosssfront.jpg" height="263" width="350" border="0" alt="mosssfront.jpg: " /></p>\n<p>Christopher Ryan \'Randy\' Moss is dressed up for Monday Night Football tonight.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/10/mosssback.jpg" height="467" width="350" border="0" alt="mosssback.jpg: " /></p>\n<hr />\nI see the weblog is on still on European time, so the date says Monday, even though it\'s still Sunday evening here in west-central Minnesota. We\'ve got pictures from both Arizona and Minnesota at "photopoint".</p>\n<p>We\'ve both had fun watching the baseball divisional playoffs, especially knowing about the fervent Mariners and Mets fans in the editthispage audience. </p>\n<p>But back home, I see Germany defeated England 1-0 at Wembley. I\'ll take a World Cup over a World Series anytime.</p>'},next:{fields:{title:"Shades",date:"05 Oct 2000",slug:"/2000-10-05-shades/"}},previous:{fields:{title:"Legion",date:"12 Oct 2000",slug:"/2000-10-12-legion/"}}},{node:{fields:{title:"Shades",date:"05 Oct 2000",slug:"/2000-10-05-shades/",tags:"Y2000"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/10/shades.jpg" height="467" width="350" border="0" alt="shades.jpg: " /></p>\n<p>We made it to Christopher\'s Grandma and Grandpa in Minnesota, where he doesn\'t need his shades anymore. We went from 38&deg;C in Phoenix to 4&deg;C here. We might even see snow tonight.</p>\n<p>After working a week with modems on borrowed computers, I miss my German ISDN line. I especially miss not having to share a computer with Mama (what, she wants to check her stocks again?!?).</p>\n<p>We\'ve been trying to collect our thoughts about comparing life in Germany and in the US, since my father signed us on to do a presentation for his Kiwanis club next Monday. My first impression: the US has changed a lot less than Germany has since I\'ve moved.</p>\n<p><a href="http://andrea.editthispage.com">Andrea</a> asked what her readers were doing for German reunification 10 years ago, and I <a href="http://andrea.editthispage.com/discuss/msgReader$1281">answered</a> on her site.</p>'},next:{fields:{title:"Ballyard",date:"01 Oct 2000",slug:"/2000-10-01-ballyard/"}},previous:{fields:{title:"Monday Night",date:"09 Oct 2000",slug:"/2000-10-09-monday-night/"}}},{node:{fields:{title:"Ballyard",date:"01 Oct 2000",slug:"/2000-10-01-ballyard/",tags:"Y2000"},html:'<p><a href="http://www.azdiamondbacks.com/bob/"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/10/bobdusk.jpg" height="251" width="250" border="0" alt="bobdusk.jpg: " /></a></p>'},next:{fields:{title:"Greetings from Arizona",date:"29 Sep 2000",slug:"/2000-09-29-greetings-from-arizona/"}},previous:{fields:{title:"Shades",date:"05 Oct 2000",slug:"/2000-10-05-shades/"}}}],pathPrefix:"",first:!1,last:!1,index:1040,pageCount:1101}}}});
